Global Text mainText;
Global Timer mainTimer;

Global int frameNumber, frameCount, frameSize;
Global double frameRate;

Global List frameList;

Function loadBadApple();
Function String decompressRLE(String in);

System.onScriptLoaded() {
  //xml stuff
  Group scriptgroup = getScriptGroup();
  mainText = scriptgroup.getObject("badapple_text");

  //create lists
  frameList = new List;

  //add frames to list
  loadBadApple();

  //how many strings are used to build a frame
  frameSize = 9;

  //frame count is length of frameList
  frameCount = frameList.getNumItems();

  frameRate = 33.3;

  //update timer
  mainTimer = new Timer;
  mainTimer.setDelay(33);

  if(frameCount % frameSize != 0) mainText.setXmlParam("text", "framecount("+integerToString(frameCount)+") is not a divisor of frameSize("+integerToString(frameSize)+")!\nThis might crash Winamp!");
  else mainText.setXmlParam("text", "Bad Apple!! in Winamp demo by mirzi (2021)\n...press play");
}

System.onPlay(){
  mainTimer.start();
}

System.onResume(){
  mainTimer.start();
}

System.onStop(){
  mainTimer.stop();
}

System.onPause(){
  mainTimer.stop();
}



mainTimer.onTimer(){
  //get correct frame number with modulo
  int frameNum = (frameSize*frameNumber)%frameCount;

  //combine strings into one
  String frame_main = "";
  for(int i = 0; i<frameSize; i++){
    frame_main += decompressRLE( frameList.enumItem(frameNum+i) );
  }

  //display frame
  mainText.setXmlParam("text", integerToString(frameNum) + "/" + integerToString(frameCount) + "\n" + frame_main);
  
  frameNumber = System.integer(System.getPosition() / frameRate);
}

//simple RLE decompression algorithm
decompressRLE(String in){
  String str = "";
  String buffer = "";
  String newline ="
";

  for (int i = 0; i < strlen(in); i++){
    String char = strmid(in, i, 1);
    if (char == "a"){
      int count = stringToInteger(buffer);
      for(int o = 0; o < count; o++){
        str+=" ";
      }
      buffer = "";
    } else if (char == "b"){
      int count = stringToInteger(buffer);
      for(int o = 0; o < count; o++){
        // str+="█";
        str+="█";
      }
      buffer = "";
    } else if (char == ","){
      str+=newline;
    } else buffer += char;
  }

  return str;
}

